def DistributionFunctio_Hernquist( E ):

    Etil = E*a/(G*M0)

    return (2**(-0.5))*(2*np.pi*(G*M0*a)**0.5)**(-3)*((Etil**0.5)/(1-Etil)**2)*((1-2*Etil)*(8*Etil**2-8*Etil-3)+(3*np.arcsin(Etil**0.5))/(Etil*(1-Etil))**0.5)

